import logo from './logo.svg';
import './App.css';
import './component/connectServer'
import {connectServer} from "./component/connectServer";

function App() {

  const allUsers = connectServer()
  return (
    <div className="App">
      {
        allUsers.map(element => {
          <p>{element.firstname}</p>
        })
      }
    </div>
  );
}

export default App;
